import React from 'react';
import { useState } from 'react';
import { Slider } from '@mui/material';

import './CreateLobby.css';

export function BotSettings() {
  const [messageLength, setMessageLength] = useState(50);
  const [messageFreq, setMessageFreq] = useState(50);

  return (
    <div style={{ 
      paddingRight: 30,
      backgroundColor: '#eeeeee',
      borderRadius: 20,
      justifyContent: 'center',
      alignItems: 'center',
      height: 468,
      width: 366,
      }}>

      <p style={{ fontSize: 25, marginBottom: 20, marginTop: 20, textAlign: 'center', }}>Bot Settings</p>
      <hr style={{ borderTop: '2px solid #E3E3E3', borderLeft: 'none' }} />

      <div style={{ margin: 20 }}>
        <p style={{ fontSize: 22, paddingBottom: 10}}>{'Custom Name'}</p>

        <input style={{ backgroundColor: '#F9F8F7', borderRadius: 20, width: 308, height: 34, border: 0, outline: 0, paddingLeft: 10 }}></input>
      </div>

      <div>
        <p style={{ fontSize: 22, marginTop: 0, marginBottom: 15, marginLeft: 20 }}>
          Assertiveness
        </p>
        <div
          className={'box-container'}
          style={{ width: 356, height: 52, padding: 20 }}
        >
          <Slider
            aria-label="Message Lengtth"
            defaultValue={30}
            valueLabelDisplay="auto"
            step={10}
            marks={false}
            min={10}
            max={110}
          />
        </div>
      </div>

      <div>
        <p
          style={{
            fontSize: 27,
            marginBottom: 15,
          }}
        >
          {'Message Frequency'}
        </p>
        <div
          className={'box-container'}
          style={{ width: 356, height: 52, padding: 20 }}
        >
          <Slider
            aria-label="Message Lengtth"
            defaultValue={30}
            valueLabelDisplay="auto"
            step={10}
            marks={false}
            min={10}
            max={110}
          />
        </div>
      </div>
      <div></div>
    </div>
  );
}
